import { Breadcrumb, Space, Divider } from "antd";
import Link from "next/link";
const MenuNavibarLayout = ({ menus }) => {
  return (
    <div style={{ backgroundColor: "white" }}>
      <Breadcrumb separator={""}>
        <Space size={`middle`}>
          {menus.map((menu) => (
            <Breadcrumb.Item>
              <Link>
                <a>
                  <h3>{menu}</h3>
                </a>
              </Link>
            </Breadcrumb.Item>
          ))}
        </Space>
      </Breadcrumb>
      <Divider />
    </div>
  );
};

export default MenuNavibarLayout;
